/*  */

/*1:          */

Create View PropuskiView6 AS
(Select Distinct (Ucenik.Name_Uc+' '+Ucenik.Famil_Uc+' '+Ucenik.Otcestvo) as FIO , 
count(Jurnal.NE_Uvaj_Prop) as Kolvo_NeUvaj 
From Ucenik,Jurnal
where (Ucenik.Cod_uc = Jurnal.Cod_uc) and (Jurnal.NE_Uvaj_Prop='1')
group by Ucenik.Name_uc,Ucenik.Famil_Uc,Ucenik.Otcestvo
)
go

Select FIO
from PropuskiView6
where Kolvo_NeUvaj = 
( select Min(Kolvo_NeUvaj)
from PropuskiView6)
go
/*++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++*/
/*2:        10*/
Create View OcenkiView AS
(Select Distinct (Ucenik.Name_Uc+' '+Ucenik.Famil_Uc+' '+Ucenik.Otcestvo) as FIO , 
count(Jurnal.Ocenka) as Kolvo_D 
From Ucenik,Jurnal
where (Ucenik.Cod_uc = Jurnal.Cod_uc) and (Jurnal.Ocenka='10')
group by Ucenik.Name_uc,Ucenik.Famil_Uc,Ucenik.Otcestvo
)
go

Select FIO
from OcenkiView
where Kolvo_D = 
( select Max(Kolvo_D)
from OcenkiView)
go

