Create View ClassVie As
Select class.N_Cl,class.Razdel,count(Ucenik.Cod_uc) as Kolvo_uc 
From Class,Ucenik
where Class.Cod_cl=Ucenik.Cod_cl
group by Class.N_Cl,Class.Razdel
go  


Select N_Cl,Razdel
From ClassVie 
where Kolvo_uc = 
( Select Max(Kolvo_uc) 
From ClassVie)
go
/*++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++*/
/*4:         2*/

Create View TeacherView AS
(Select Teacher.Name_Teacher , 
count(Jurnal.Ocenka) as Kolvo_dva 
From Teacher,Jurnal
where (Teacher.Cod_Teacher = Jurnal.Cod_Teacher) and (Jurnal.Ocenka='2')
group by Teacher.Name_Teacher
)
go

Select Name_Teacher
from TeacherView
where Kolvo_dva = 
( select Max(Kolvo_dva)
from TeacherView)
go
