Create View AvgOcenkaView5 As
select Distinct (Ucenik.Name_uc+' '+Ucenik.Famil_Uc+' '+Ucenik.Otcestvo) as FIO, AVG(Jurnal.Ocenka) as AvgOcenka
from Ucenik,Jurnal
where Ucenik.Cod_uc=Jurnal.Cod_uc
group by Ucenik.Name_uc,Ucenik.Famil_Uc,Ucenik.Otcestvo
go

Select * 
from AvgOcenkaView5
where AvgOcenka = 
( select Max(AvgOcenka)
from AvgOcenkaView5)
go


