/*3:     2    10*/

Create view OtlicnikView AS
select Distinct (Ucenik.Name_uc+' '+Ucenik.Famil_Uc+' '+Ucenik.Otcestvo) as FIO,
count (Jurnal.Cod_uc) as Kolvo
from Ucenik inner join Jurnal on
((Ucenik.Cod_uc=Jurnal.Cod_uc) and (Jurnal.Ocenka ='10'))
group by Ucenik.Name_uc,Ucenik.Famil_Uc,Ucenik.Otcestvo
go



Select * 
from OtlicnikView
where Kolvo>=2
go

